import React from "react";
import { NavLink } from "react-router-dom";
import img from "../slike/logo.png";

const Navbar = () => {
  return (
    <div className="h-screen w-[250px] bg-yellow text-black">
      <div className="h-[20%] flex justify-center items-center">
        <img src={img} className="mt-8 shadow-xl cursor-pointer" />
      </div>
      <div className="h-[80%]">
        <li className="block text-2xl bg-white shadow-lg hover:bg-yellow hover:text-white">
          <NavLink to="/leagues" className="text-black pl-4">
            Leagues
          </NavLink>
        </li>
        <li className="block  mt-2 text-2xl bg-white shadow-lg hover:bg-yellow hover:text-white">
          <NavLink to="/teams" className="pl-4">
            Teams
          </NavLink>
        </li>
        <li className="block  mt-2 text-2xl bg-white shadow-lg hover:bg-yellow hover:text-white">
          <NavLink to="/transfers" className="pl-4">
            Transfers
          </NavLink>
        </li>
        <li className="block  mt-2 text-2xl bg-white shadow-lg hover:bg-yellow hover:text-white">
          <NavLink to="/livegames" className="pl-4">
            Live games
          </NavLink>
        </li>{" "}
      </div>
    </div>
  );
};

export default Navbar;
